import React, { Component } from "react";
import Navbar from './Navbar';




export default class App extends Component {

  constructor(props){
    super(props)
    this.state={
      account:""
    }
  }


  render() {
    return (
      <div>
        <Navbar/>
      </div>
    );
  }
}
